.swiper-slide
{
  text-align: center;
  font-size: 18px;
  display: -webkit-box;
  display: -ms-flexbox;
  display: -webkit-flex;
  display: flex;
  -webkit-box-pack: center;
  -ms-flex-pack: center;
  -webkit-justify-content: center;
  justify-content: center;
  -webkit-box-align: center;
  -ms-flex-align: center;
  -webkit-align-items: center;
  align-items: center;
}
.swiper-pagination-bullet
{
  background: #fff;
}
.bmwButtonContainer
{
  position: relative;
  margin: 0 auto;
  width: 100%;
  padding-right: 15px !important;
  padding-left: 15px !important;
}
.bmwButtonContainer button
{
  width: 100%;
  height: 50px;
  border: none;
  display: block;
}
.buttonText
{
  padding-top: 5px;
}
.singleButton
{
  top: 40%;
  z-index: 0;
}
.singleButton button, .groupButton button
{
  background-color: #404648;
}
.groupButton
{
  top: 35%;
  z-index: 0;
}
.textBoxContainer
{
  display: inline-block;
  position: fixed;
  width: 100%;
  padding-bottom: 100%;
  vertical-align: middle;
  overflow: hidden;
  height: 100px;
  top: 50%;
}
.textBox
{
	display: inline-block;
	position: absolute;
	top: 0;
	left: 0;
  right: 0;
  width: 92%;
  margin: 0 auto;
}
.secondaryButton
{
  background-color: transparent !important;
  margin-top: 5px;
}

<script>
//initialize swiper
var swiper = new Swiper('.swiper-container',
{
  pagination:
  {
    el: '.swiper-pagination',
  },
  zoom:
  {
    maxRatio: 1,
    toggle: false,
  },
});
function onUAReady()
{
   //set url destinations for CTAs
   let buttonOne = 'buttonOne';
   let buttonTwo = 'buttonTwo'
   let destinationOne = 'https://www.apple.com/';
   let destinationTwo = 'https://www.google.com/';
   var ctaOne = document.getElementById("ctaOne");
   var ctaTwo = document.getElementById("ctaTwo");
   var ctaTwo = document.getElementById("remindMeLater");
   // add tags to buttons so the url can be linked
   ctaOne.addEventListener("click", function(event)
   {
     event.preventDefault();
     UAirship.runAction("add_tags_action", buttonOne, function()
     {
        UAirship.runAction("open_external_url_action", destinationOne, function()
        {
          return true;
        })
     });
   });
   ctaTwo.addEventListener("click", function(event)
   {
     event.preventDefault();
     UAirship.runAction("add_tags_action", buttonOne, function()
     {
        UAirship.runAction("open_external_url_action", destinationOne, function()
        {
          return true;
        })
     });
   });
   // remindMeLater.addEventListener("click", function(event)
   // {
   //     same logic that the x button in the corner would do
   // });
};
document.addEventListener('ualibraryready', onUAReady, false);
</script>
